description:
[Request]

An easy way to give your photos that sought-after cartoon look. ToonIt! uses advanced algorithms to process your image and create cartoon shading and lines. The Adobe Photoshop cartooning plug-in frees you from time consuming techniques like rotoscoping and hand painting.

Info:

- Install and copy crack to Photoshop Plugins dir

Working in CS6
